import React from 'react';
import './about.css';
import { Routes, Route } from 'react-router-dom'

const styles = {
    background: {
        background: 'green'
    }
}

export default function About() {
    return (
        <div>
            <div class="topImg">

            </div>
            <Routes>
                        <Route path='/' element={<About />} />
                        <Route path='/partners' element={<Partners />} />
                        <Route path='/addcause' element={<AddCause />} />
                        <Route path='/login' element={<Login />} />
                    </Routes>

            <div class="bottomImg">
                <div>
                    <img class="img-fluid" src={'image1.jpg'} alt="volunteering"></img>
                </div>
                <div class="container" style={styles.background}>
                    <h2>Who we are.</h2>
                </div>


            </div>
        </div>

    )
}
